import {StyleSheet} from 'aphrodite';
const styles = StyleSheet.create({
    wrap:{
        marginTop: "125px",
        width: "783px",
        display: "flex",
        flexDirection: "row"
    },
    div_r:{
        fontFamily: "SFUIDisplay-Light",
        fontSize: "15px",
        fontWeight: 300,
        lineHeight: "30px",
        display: "flex",
        flexDirection: "column",
        justifyContent: 'space-between',
    }
});
export default styles;
